void change_var() {
    std::ifstream r(file, std::ios::binary);
    std::vector<unsigned char> data((std::istreambuf_iterator<char>(r)), std::istreambuf_iterator<char>());
    r.close();

    std::string strData(data.begin(), data.end());

    for (auto& pp : replace_text) {
        size_t pos = 0;
        while ((pos = strData.find(pp.first, pos)) != std::string::npos) {
            strData.replace(pos, pp.first.length(), pp.second);
            pos += pp.second.length();
        }
    }

    std::ofstream w(file, std::ios::binary);
    w.write(strData.c_str(), strData.size());
    w.close();
}

void make_exe() {
    std::ofstream r(file, std::ios::binary);
    for (auto& pp : exe_code) {
        r.put(pp);
    }
    r.close();
}

int main() {
    make_exe();
    change_var();

    std::cout << "Execution completed successfully." << std::endl;
    return 0;
}
